import Input from "../UI/Input";

import styles from "./SweetItemForm.module.css";

const SweetItemForm = (props) => {
  return (
    <form className={styles.form}>
      <Input
        label="sztuki"
        input={{
          id: "amount_" + props.id,
          type: "number",
          min: "1",
          max: "5",
          step: "1",
          defaultValue: "1",
        }}
      />
      <button>Dodaj</button>
    </form>
  );
};
export default SweetItemForm;
